import React from 'react';
import './app.css'

import AppHeader from '../app-header'
import FructList from '../fruct-list';

const App = () => {
  return (
    <div className="component-app">
      <AppHeader />
      <div class="co">Catalog</div>
      <FructList />
    </div>
  )
}

export default App;
